import React from "react";
import "./Dictionary.css";
export default function Dictionary() {
  function search() {
    alert("Searching ...");
  }
  return (
    <div className="Dictionary">
      <form>
        <input type="search" autoFocus={true} onSubmit={search} />
      </form>
    </div>
  );
}
